import React from "react";
import {NextPage} from 'next';
import Layout from '../../components/Layout/Layout';
import Banner from "../../components/Post/Banner";
import Cards from "../../components/Post/Cards";
import Mission from "../../components/Post/Mission";
import Strengths from "../../components/Post/Strengths";
import AboutUs from "../../components/Post/AboutUs";
import "../../assets/scss/style.scss";
import {mainURL} from "../../constants";

interface PostProps {

}
const Post: NextPage<PostProps> = (prop: PostProps) => {
  let pageTitle = 'Giới thiệu về Nhà Đất Mới - Website thương mại điện tử Bất động sản';
  let pageDescription = 'Tin rao của bạn sẽ được tiếp cận một lượng khách hàng lớn nhất bằng công nghệ. Đăng tin theo cách của bạn, còn lại để Nhà Đất Mới lo. Mang tới cho người mua và người bán những giao dịch kiểu mới: nhanh, chuẩn, chính xác.';
  let canonicalTagUrl = mainURL + '/about-us';
  return (
    <Layout
      title={pageTitle}
      description={pageDescription}
      {...prop}
      canonical={ canonicalTagUrl }
      path={''}
    >
      <Banner/>
      <Cards/>
      <Mission/>
      <Strengths/>
      <AboutUs/>
    </Layout>
    
  );
};

export default Post;
